import { CImage } from "@coreui/react";
import React from "react";
import img1 from "../images/digital_artwork/IMG_1092.PNG";

function Art() {
    return (
        <div>
            <Container>
                <Row>
                    <Col>
                        <CImage className="art_images" rounded src={img1} />
                    </Col>
                </Row>
            </Container>

        </div>
    )
}

export default Art;
